import React from 'react';
import './card.css';

type CardProps = {
    showName: string,
    artistName: string,
    danceType: string,
    img: string,
    year: number,
}

type CardType = React.FunctionComponent<CardProps>
const Card: CardType = (props: CardProps) => { 
    return (
        <div className='card'>
            <div>
                CARD
            </div>
        </div>
    ) 
}

export default Card;
